    constructor(reelService, alertify) {
        this.reelService = reelService;
        this.alertify = alertify;
        this.componentParams = {};
        this.pageNumber = 1;
        this.pageSize = 20;
    }
    ngOnInit() {
        this.GetHistory();
    }
